import styled from "styled-components";

const StyledButton = styled.button`
  display: block;

  width: 320px;
  height: 90px;

  border-radius: 5px;
  background: #00a9ce;

  color: #fff;
  font-size: 32px;
  font-family: "Roboto", sans-serif;
  font-weight: bold;

  border: none;
  outline: none;
`;

const Button = ({ children, style }) => {
  return <StyledButton  >{children}</StyledButton>;
};

export default Button;
